const initalState = {
    name: 'zerocho',
    age : 27,
    password : 'babo',
};
const ChangeNickname = {
    type: 'CHANGE_NICKNAME',
    data: 'boogicho',
}

const rootReducer = (state = initalState, action)=>{
    switch(action.type) {
        case 'CHANGE_NICKNAME':
            return{
                ...state,
                name: action.data,
            }
    }
};

export default rootReducer
